{
    /*** Calculate (Configuration NULL) ***/
    /* Variable */
    uint8_t data[1];

    /* Calculate */
    TEST_ASSERT_EQUAL_HEX32(0x00000000, crc32_calculate(NULL, data, sizeof(data)));
}

